import sys
import re

def parse_golorp(name):
    # Extract the part after '?(' and before '):-'
    match = re.search(r'\?$$([^)]*)$$:-', name)
    if not match:
        return "false"

    jaw_pattern = match.group(1)

    # Extract the parts after '):-' which define the constraints
    constraint_part = name.split('):-')[1]

    # Split on commas to get individual constraints
    constraints = [c.strip() for c in constraint_part.split(',')]

    # Parse each constraint into a tuple of (operator, left, right)
    parsed_constraints = []
    for c in constraints:
        if '>' in c:
            op = '>'
            left, right = c.split('>')
        elif '<' in c:
            op = '<'
            left, right = c.split('<')
        else:
            continue

        left = int(left) if left.isdigit() else left
        right = int(right) if right.isdigit() else right
        parsed_constraints.append((op, left, right))

    # Generate all possible variable sequences based on the jaw pattern
    # '?' represents a variable, others are fixed values
    var_positions = [i for i, ch in enumerate(jaw_pattern) if ch == '?']
    num_vars = len(var_positions)

    from itertools import product

    # Try all combinations of 0-9 for the variables
    for values in product(range(10), repeat=num_vars):
        sequence = list(jaw_pattern)
        for i, pos in enumerate(var_positions):
            sequence[pos] = str(values[i])

        valid = True
        for op, left, right in parsed_constraints:
            # Handle both sides being numbers or variables
            try:
                l_val = int(left) if isinstance(left, str) and left.isdigit() else values[int(left)]
                r_val = int(right) if isinstance(right, str) and right.isdigit() else values[int(right)]
            except:
                valid = False
                break

            if op == '>':
                if not (l_val > r_val):
                    valid = False
                    break
            elif op == '<':
                if not (l_val < r_val):
                    valid = False
                    break

        if valid:
            return ''.join(sequence)

    return "false"

def main():
    input_str = sys.stdin.read().strip()
    # Assuming input is a list of strings as in the example
    inputs = input_str.split('\n')
    results = [parse_golorp(name) for name in inputs]
    for res in results:
        print(res)

if __name__ == "__main__":
    main()
